import React from 'react';

const axios = require('axios');
const user_data_example = {
    id: 101,
    firstName: 'Sue',
    lastName: 'Corson',
    email: 'DWhalley@in.gov',
    phone: '(612)211-6296',
    address: {
        streetAddress: '9792 Mattis Ct',
        city: 'Waukesha',
        state: 'WI',
        zip: '22178'
    },
    description: 'et lacus magna dolor...',
};

const Container = React.memo(function(props){

    let data = {};
    let url_small = `http://www.filltext.com/?rows=32&id=${user_data_example.number|1000}`+
        `&firstName=${user_data_example.firstName}&lastName=${user_data_example.lastName}&email=${user_data_example.email}`+
        `&phone=${user_data_example.phone|'(xxx)xxx-xx-xx'}&address=${user_data_example.address}&description=${user_data_example.description|32}`;

    // axios.get(url_small).then(()=>{
    //
    // });
    console.log(url_small);

    return <div className='container'>
        opa, govna esh
    </div>
});

export default Container;
